    "    y_prob = loaded_model.predict_proba(X)[:, i]  # Probabilities for the current class\n",
    "\n",
    "    # Compute ROC and AUC\n",
    "    fpr, tpr, thresholds = roc_curve(y_true, y_prob)\n",
    "    auc = roc_auc_score(y_true, y_prob)\n",
